import React, { useState, useEffect } from 'react'

function LoginPopup(props) {
  const Passvalue = (Data_ID,Data_Type) => {
    document.getElelementByID("Data_ID").value=Data_ID;
    document.getElelementByID("Data_Type").value=Data_Type;

    document.miformulario.submit();
  }

  return (
    <div>
      <form>
        <h3>Login</h3>
        <div className="form-group" >
          <label>Username</label>
          <input id="username-element" type="username" className="form-control" placeholder="Enter email" />
        </div>
        <div className="form-group">
          <label>Password</label>
          <input  id="password-element"  type="password" className="form-control" placeholder="Enter password" />
        </div>
        <button type="submit" className="btn btn-primary btn-block" onClick={(e) => {props.isLoggedIn(
          document.getElelementByID("username-element").target.value,
          document.getElelementByID("password-element").target.value
        )}}>Submit</button>
      </form>
    </div>

  )
}

export default LoginPopup
